  \"Results, Timing of Impoundment Drawdowns and Impact on Waterbird, Invertebrate,
  and Vegetation Communities within Managed Wetlands\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:50.523789\",\n\t\"name\": \"results-timing-of-impoundment-drawdowns-and-impact-on-waterbird-invertebrate-and-vegetatio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Managed wetlands provide a broad spectrum
  of resources to migratory waterbirds throughout the annual cycle.  This study was
  part of a three-year management experiment that compared the impacts of early vs.
  late season wetland management actions on waterbirds, invertebrates, and vegetation
  communities.  Twenty-two National Wildlife Refuges in U.S. Fish and Wildlife Service
  Regions 3 and 5 collaborated; experimental management actions were applied to two
  wetland units at each refuge.  The two primary treatments were an early season drawdown
  timed to coincide with spring shorebird migration (Treatment A), and a late season
  drawdown coinciding with summer/fall shorebird migration (Treatment B).  Response
  variables were measured throughout the annual cycle.  This appendix provides the
  detailed results for each refuge.  Some results are draft and were never finalized.\",\n\t\"license_title\":
